import React from 'react'
import {Form, Image} from 'react-bootstrap'

export default function Register(){
    return(
        <>
            <Form>
                <Form.Group controlId="title">
                    <Form.Label>Registration Info</Form.Label>
                </Form.Group>
            </Form>
        </>
    );
}
